import { NavLink } from "react-router-dom";

const NavBar = () => {
  return (
    <nav className="main-nav my-auto">
      <ul className="flex flex-row md:gap-8 justify-around align-middle md:justify-center  gap-1 my-auto font-serif text-l md:text-2xl py-2  ">
        <li>
          <NavLink to="/" className="active:font-bold">Home</NavLink>
        </li>
        <li>
          <NavLink to="/random" className="active:font-bold">Random</NavLink>
        </li>
        <li>
          <NavLink to="/mycollections" className="active:font-bold">My Collections</NavLink>
        </li>
      </ul>
    </nav>
  );
};

export default NavBar;
